import React from "react";
import './LeftNav.css';
import linked from '../src/assets/linkedin.png';
import gitHub from '../src/assets/git-link.png';
import insta from '../src/assets/insta-link-logo.png';


export default function LeftNav() {
    return (
        <div className="left-nav-container">
            <a id='logo' href="#" target="#"><img  src="../assets/logo.png" alt="logo" width="50px" /></a>
            <div class="left-nav-social-links">
            <div id="left-nav-one" class="left-nav-link-container"><a href="../https://www.linkedin.com/in/trevor-sykes-717585136/" target="_blank"><img class="social-links" src={linked} alt="" /></a></div>
            <div id="left-nav-two" class="left-nav-link-container"><a href="../https://github.com/trevarious" target="_blank"><img class="social-links" src={gitHub} alt="" /></a></div>
            <div id="left-nav-three" class="left-nav-link-container"><a href="../https://instagram.com"><img class="social-links" src="../assets/insta-link-logo.png" alt="" /></a></div>
            <div id="left-nav-four"><a href="https://instagram.com"><img class="social-links" src="../assets/card-1.png" alt="" /></a></div>
            <div id="left-nav-five"><a href="https://instagram.com"><img class="social-links" src="../assets/dice.png" alt="" /></a></div>
        </div>
        </div>
    )
}
